import react from "react";
import { ExpenseModel } from "../../Model/ExpenseModel";


export class MockDataModel  {

  country : string ;
  hotDog : number ;
  hotDogColor : string ;
  burger : number ;
  burgerColor : string ;
  sandwich : number ;
  sandwichColor : string ;
  kebab : number ;
  kebabColor : string ;
  fries : number ;
  friesColor : string ;
  donut : number ;
  donutColor : string ;


  constructor(country : string , hotDog : number , hotDogColor : string 
                  , burger : number, burgerColor : string , sandwich : number ,sandwichColor : string , kebab : number , 
                  kebabColor : string , 
                    fries : number ,friesColor : string ,donut : number ,donutColor : string )
                    {

                      this.country = country;
                      this.hotDog = hotDog;
                      this.hotDogColor = hotDogColor;
                      this.burger = burger;
                      this.burgerColor = burgerColor;
                      this.sandwich = sandwich;
                      this.sandwichColor = sandwichColor;
                      this.kebab = kebab;
                      this.kebabColor = kebabColor;
                      this.fries = fries;
                      this.friesColor = friesColor;
                      this.donut = donut;
                      this.donutColor = donutColor;


  }



}
